import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles({
  card: {
    maxWidth: 345,
    margin:"0 37%"
  },
  media: {
    height: 140,
  },
});
function move(el){
  setInterval(()=>{
    if(el.style.marginLeft<=500)
      el.style.marginLeft+=10
    else{
      if(el.style.marginLeft>=20)
        el.style.marginLeft-=10
    }
  },100);
}
function moveOn(el){
  console.log(el)
  console.log(el.style.color)
}
function App() {
  const classes = useStyles();
  return (
    <div className="App" style={{textAlign:"center",margin:50}}>
      <h3>Welcome to <span style={{color:"green"}}>Clean Evn, Easy Cash</span> App</h3><br/>
      <Card className={classes.card}>
      <br/>
        <form noValidate autoComplete="off" onClick={moveOn(this)}>
            <span>
              <TextField id="standard-basic" variant="outlined" label="Name" />
            </span><br/><br/>
            <span style={{marginTop:40}}>
              <TextField id="standard-basic" variant="outlined" label="Password" />
            </span><br/><br/>
            <Button variant="contained" color="primary">
              Sign-In
            </Button>
        </form>
        <br/>
      </Card>
    </div>
  );
}

export default App;
